svg.script:

const cord = document.getElementById('cord')
const cTex = document.getElementById('cordText')
const clt = document.getElementById('clt')
clt.addEventListener('mousemove',(e)=>{
  cord.innerHTML = `x: ${e.pageX} y: ${e.pageY}`
  cTex.setAttribute('transform',`translate(${e.pageX},${e.pageY})`)
})
